('OK1151', '8422', '712130', 1, 12, 18, 1, '2025-06-16 00:00:00', NULL, 'IAC 2022-2026', 'Oklahoma City Zoo', 'Trevor Leonard', 'Trevor.Leonard@okc.gov', '405-424-3344', NULL, '2000 Remington Place', NULL, NULL, 'Oklahoma City', 'OK', '73111', NULL, 22000000, 150, 500000, 'Zoological Garden', 1, 'Units', 2340, 'obtained through scraping', '2025-08-15 00:00:00', '2025-06-16 00:00:00', '2025', 'The facility is in Oklahoma City, Oklahoma. Oklahoma City Zoo & Botanical Garden, is a 130-acre facility home to over 2,000 animals across 500+ species. This opportunity was initiated at the request of OG&E, the local utility provider, and aligns closely with our strategic efforts to expand energy efficiency initiatives across key institutions in Oklahoma. While the overall facility appears large, the conditioned space falls within the estimated range of 100,000 sq ft, keeping the project well within DOE guidelines for commercial energy assessments. Given the zoo’s high public visibility and community impact, this assessment represents a significant opportunity to demonstrate DOE-supported energy leadership and stakeholder engagement in the region. We received formal approval from John Smegal on Thursday, June 12, 2025, 11:39 AM.', 1100, 50, NULL, NULL, NULL, NULL, 'active'),
